import React from "react";
import "../App.css";
import { Tabs, TabList, Tab } from '@chakra-ui/react';
import { extendTheme } from "@chakra-ui/react";
import logo from './UniversityOfWaterloo_logo_horiz_bk.png';

// Extend the default Chakra UI theme with your custom styles
const theme = extendTheme({
  components: {
    Tabs: {
      baseStyle: {
        tab: {
          textDecoration: "underline solid transparent",
          transition: "text-decoration 1s ease",
          _hover: {
            textDecoration: "underline solid CurrentColor"
          }
        }
      }
    }
  }
});

function HeaderBar() {
  return (
    <div style={{ textAlign: 'center', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh' }}>
      <Tabs align='center' variant="unstyled" theme={theme} style={{ marginBottom: '20px' }}>
        <TabList>
          <Tab>About</Tab>
          <Tab>Projects</Tab>
          <Tab>Resume</Tab>
          <Tab>Github</Tab>
        </TabList>
      </Tabs>
      <div style={{ display: 'flex', justifyContent: 'center' }}>
        <img 
          src={logo}
          alt='University of Waterloo'  
          style={{ width: '400px', height: 'auto', margin: '20px 0',  align: 'center', alignContent: 'center'}}
        />
      </div>
      <h1 style={{ fontSize: '48px', margin: '10px 0' }}>Khyle Dhanani</h1>
    </div>
  );
}

export default HeaderBar;
